import image1 from './image1.jpg';

import './grid.css';

class grid extends Component {
    render() {
        return (
            <div className="container">
            <div className="card">
                <div className="card-background">
                    <img src={image1} className="card-image" alt=""/>

                </div>

                <div classname="card-info">
                <h1>Mr.Bean</h1>
                </div>

            </div>
            <div className="card">
                <div className="card-background">
                    <img src={image1} className="card-image" alt=""/>

                </div>

                <div classname="card-info">
                <h1>Mr.Bean</h1>
                </div>

            </div>
            <div className="next-card">
                <div className="card-background2">
                    <img src={image1} className="card-image2" alt=""/>

                </div>

                <div classname="card-info2">
                <h1>Mr.Bean</h1>
                </div>

            </div>

            </div>


    );
}
}
export default grid;
